import React, { Component } from 'react';
import Navbar1 from '../components/Navbar1';
import logo from '../assets/logoif.png'

class Login extends Component {
    state = {  }

    render() { 
        return ( 
            <section>
                <Navbar1 />
                <br></br>
                <div className='container-fluid'>
                    <img style={{height:'100px',width:'100px'}} className='text-center' src={logo} />
                    <h5 className='text-center'>SELAMAT PAGI !!!</h5>
                    <p className='text-center'>Selamat Datang di Website praktikum Laboratorium Informatika Telkom University</p>
                    <p className='text-center pt-0'>Website Ini Akan Digunakan untuk melaksanakan Praktikum</p>
                </div>
            </section>

         );
    }
}

export default Login;
